var Count=0;

function App(){
    function UpdateTime(){
        const State = useState();
        let [count,updCount] = useState(0);
         updCount = count++;
         console.log(count);
    }
    return(
        <>
        <h1>{Count}</h1>
        <button onClick={UpdateTime()}>Click Me</button>
        </>
    );
}

export default App;
